import Note from "./Note"



const Project = props => {
    const notes = props.notes;
    return (
    <div>
            <h1>{props.project}</h1>
            <div>{
                Object.keys(notes).map((note,i) => {
                    console.log("note: ", i);
                    <Note key={i} type={note.type} text={note.text} title={note.title} url={note.url}/>;})
            }
            </div>
    </div>)
}




export default Project;
